script: |
  super -f tsv -I q5347.sql | sort > q5347.out

vector: true

inputs:
  - name: q5347.sql
    data: |
      pragma pg
      SELECT - col2 AS col1 FROM tab0 AS cor0 GROUP BY col1, col2 HAVING NOT CAST ( CASE 67 WHEN - 28 THEN col1 / col1 + - col1 * - col1 END AS INTEGER ) + col2 BETWEEN 10 AND col2;
  - name: tab0

outputs:
  - name: q5347.out
    data: |
